import React, {Component} from 'react';
import {ProgressBar} from "react-mdl";

import '../App.css'
import { Grid, Cell } from "react-mdl";

class LandingPage extends Component {
    render() {
        return (
            <div className="landcontainer">

                <Grid className="landGrid">
                    <Cell col={12}>
                        <img
                            className="avatar-img"
                            src="https://thumbs.dreamstime.com/z/girl-lovely-avatar-blonde-hair-cartoon-icon-stock-vector-93364827.jpg" />
                        <img
                            className="avatar-img"
                            src="https://thumbs.dreamstime.com/z/cute-vector-girl-avatar-icon-young-woman-face-pretty-lady-port-portrait-cartoon-illustration-beautiful-brunette-76317393.jpg" />
                    </Cell>


                </Grid>
                <h1>LandingPage Component!</h1>
                <ProgressBar progress={25} buffer={60}/>
            </div>
        );
    }
}

export default LandingPage;
